INPUT_P_Element_10_gameplay_env_rdxcode_:
#require(curl.glsl)

vec3 curl = curlNoise(pos * uCurlNoiseScale*0.1 + (time * uCurlTimeScale * 0.1));
pos += curl * uCurlNoiseSpeed * 0.01;

if (pos.y < -1.0) {
    pos.y = 20.0;

    vec3 o = origin;
    o = o + 2.0 * cross(uCarQuat.xyz, cross(uCarQuat.xyz, o) + uCarQuat.w * o);

    pos.x = uCarPos.x + o.x;
    pos.z = uCarPos.z + o.z;

    if (length(pos.xz) > 10.0) pos.y = origin.y;

}

